c**********************************************************************c
c Reads the type of input image scalled between 0 and 255. If itype is c
c -1 the image has values of reflectance. If itype is 0 the image has  c
c only digital numbers from ETM+ taken before July 1, 2000. If itype   c
c is 1 the image has only digital numbers from ETM+ taken after July   c
c 1, 2000. If itype is 2 the image has radiance values of radiance     c
c scalled between 0 and 255. The total number of pixels of the RAW     c
c binary image (ntpixels) must be entered after itype (this is equal   c
c to the total number of bytes of the image). RAW image means an image c
c without header or any other information other than the gray level    c
c values in 8 bits.                                                    c
c**********************************************************************c

