   53   continue
   52 continue

c ---- spectral loop ----
      if (iwave.eq.-2) write(iwr,1500)
      do 51 l=iinf,isup
        sbor=s(l)
        if(l.eq.iinf.or.l.eq.isup) sbor=sbor*0.5
        if(iwave.eq.-1) sbor=1.0/step
        roc=rocl(l)
        roe=roel(l)
        wl=.25+(l-1)*step
c
        call abstra(idatm,wl,xmus,xmuv,uw/2.,uo3,uwus,uo3us,
     a             idatmp,puw/2.,puo3,puwus,puo3us,
     a      dtwava,dtozon,dtdica,dtoxyg,dtniox,dtmeth,dtmoca,
     a      utwava,utozon,utdica,utoxyg,utniox,utmeth,utmoca,
     a      attwava,ttozon,ttdica,ttoxyg,ttniox,ttmeth,ttmoca )
        call abstra(idatm,wl,xmus,xmuv,uw,uo3,uwus,uo3us,
     a             idatmp,puw,puo3,puwus,puo3us,
     a      dtwava,dtozon,dtdica,dtoxyg,dtniox,dtmeth,dtmoca,
     a      utwava,utozon,utdica,utoxyg,utniox,utmeth,utmoca,
     a      ttwava,ttozon,ttdica,ttoxyg,ttniox,ttmeth,ttmoca )
        if (dtwava.lt.accu3) dtwava=0.
        if (dtozon.lt.accu3) dtozon=0.
        if (dtdica.lt.accu3) dtdica=0.
        if (dtniox.lt.accu3) dtniox=0.
        if (dtmeth.lt.accu3) dtmeth=0.
        if (dtmoca.lt.accu3) dtmeth=0.
        if (utwava.lt.accu3) utwava=0.
        if (utozon.lt.accu3) utozon=0.
        if (utdica.lt.accu3) utdica=0.
        if (utniox.lt.accu3) utniox=0.
        if (utmeth.lt.accu3) utmeth=0.
        if (utmoca.lt.accu3) utmeth=0.
        if (ttwava.lt.accu3) ttwava=0.
        if (ttozon.lt.accu3) ttozon=0.
        if (ttdica.lt.accu3) ttdica=0.
        if (ttniox.lt.accu3) ttniox=0.
        if (ttmeth.lt.accu3) ttmeth=0.
        if (ttmoca.lt.accu3) ttmeth=0.
c
        call solirr(wl,
     s            swl)
        swl=swl*dsol
        coef=sbor*step*swl
        call interp (iaer,idatmp,wl,taer55,taer55p,xmud,
     s             romix,rorayl,roaero,phaa,phar,tsca,
     s             tray,trayp,taer,taerp,dtott,utott,
     s             astot,asray,asaer,
     s             utotr,utota,dtotr,dtota)
        dgtot=dtwava*dtozon*dtdica*dtoxyg*dtniox*dtmeth*dtmoca
        tgtot=ttwava*ttozon*ttdica*ttoxyg*ttniox*ttmeth*ttmoca
        ugtot=utwava*utozon*utdica*utoxyg*utniox*utmeth*utmoca
        tgp1=ttozon*ttdica*ttoxyg*ttniox*ttmeth*ttmoca
        tgp2=attwava*ttozon*ttdica*ttoxyg*ttniox*ttmeth*ttmoca
        edifr=utotr-exp(-trayp/xmuv)
        edifa=utota-exp(-taerp/xmuv)
          call enviro(edifr,edifa,rad,palt,xmuv,
     s               fra,fae,fr)
          avr=roc*fr+(1.-fr)*roe
          rsurf=roc*dtott*exp(-(trayp+taerp)/xmuv)/(1.-avr*astot)
     s       +avr*dtott*(utott-exp(-(trayp+taerp)/xmuv))/(1.-avr*astot)
        ratm1=(romix-rorayl)*tgtot+rorayl*tgp1
        ratm3=romix*tgp1
        ratm2=(romix-rorayl)*tgp2+rorayl*tgp1
        romeas1=ratm1+rsurf*tgtot
        romeas2=ratm2+rsurf*tgtot
        romeas3=ratm3+rsurf*tgtot
C    computing integrated values over the spectral band
        if (iwave.eq.-2) then
          write(iwr,1501) wl,tgtot,dtott,utott,astot,ratm2,swl,step,
     s            sbor,dsol,romeas2
        endif
        alumeas=xmus*swl*romeas2/pi
        fophsa=fophsa+phaa*coef
        fophsr=fophsr+phar*coef
        sasr=sasr+asray*coef
        sasa=sasa+asaer*coef
        sast=sast+astot*coef
        sroray=sroray+rorayl*coef
        sroaer=sroaer+roaero*coef
        sodray=sodray+tray*coef
        sodaer=sodaer+taer*coef
        sodrayp=sodrayp+trayp*coef
        sodaerp=sodaerp+taerp*coef
        ssdaer=ssdaer+tsca*coef
        sodtot=sodtot+(taer+tray)*coef
        sodtotp=sodtotp+(taerp+trayp)*coef
        srotot=srotot+(romix)*coef
        rog=rog+roc*coef
        refet=refet+romeas2*coef
        refet1=refet1+romeas1*coef
        refet2=refet2+romeas2*coef
        refet3=refet3+romeas3*coef
        alumet=alumet+alumeas*sbor*step
        tgasm=tgasm+tgtot*coef
        dgasm=dgasm+dgtot*coef
        ugasm=ugasm+ugtot*coef
        sdwava=sdwava+dtwava*coef
        sdozon=sdozon+dtozon*coef
        sddica=sddica+dtdica*coef
        sdoxyg=sdoxyg+dtoxyg*coef
        sdniox=sdniox+dtniox*coef
        sdmeth=sdmeth+dtmeth*coef
        sdmoca=sdmoca+dtmoca*coef
        suwava=suwava+utwava*coef
        suozon=suozon+utozon*coef
        sudica=sudica+utdica*coef
        suoxyg=suoxyg+utoxyg*coef
        suniox=suniox+utniox*coef
        sumeth=sumeth+utmeth*coef
        sumoca=sumoca+utmoca*coef
        stwava=stwava+ttwava*coef
        stozon=stozon+ttozon*coef
        stdica=stdica+ttdica*coef
        stoxyg=stoxyg+ttoxyg*coef
        stniox=stniox+ttniox*coef
        stmeth=stmeth+ttmeth*coef
        stmoca=stmoca+ttmoca*coef
        sdtotr=sdtotr+dtotr*coef
        sdtota=sdtota+dtota*coef
        sdtott=sdtott+dtott*coef
        sutotr=sutotr+utotr*coef
        sutota=sutota+utota*coef
        sutott=sutott+utott*coef
        sb=sb+sbor*step
        seb=seb+coef

c    output at the ground level.
        tdir=exp(-(tray+taer)/xmus)
        tdif=dtott-tdir
        etn=dtott*dgtot/(1.-avr*astot)
        esn=tdir*dgtot
        es=tdir*dgtot*xmus*swl
        ea0n=tdif*dgtot
        ea0=tdif*dgtot*xmus*swl
        ee0n=dgtot*avr*astot*dtott/(1.-avr*astot)
        ee0=xmus*swl*dgtot*avr*astot*dtott/(1.-avr*astot)
        if (etn.gt.accu3) then
           ani(1,1)=esn/etn
           ani(1,2)=ea0n/etn
           ani(1,3)=ee0n/etn
        else
           ani(1,1)=0.
           ani(1,2)=0.
           ani(1,3)=0.
        endif
        ani(2,1)=es
        ani(2,2)=ea0
        ani(2,3)=ee0
        do 955 j=1,3
          aini(1,j)=aini(1,j)+ani(1,j)*coef
          aini(2,j)=aini(2,j)+ani(2,j)*sbor*step
  955   continue
 
c    output at satellite level
        tmdir=exp(-(tray+taer)/xmuv)
        tmdif=utott-tmdir
        xla0n=ratm2
        xla0=xla0n*xmus*swl/pi
        xltn=roc*dtott*tmdir*tgtot/(1.-avr*astot)
        xlt=xltn*xmus*swl/pi
        xlen=avr*dtott*tmdif*tgtot/(1.-avr*astot)
        xle=xlen*xmus*swl/pi
        anr(1,1)=xla0n
        anr(1,2)=xlen
        anr(1,3)=xltn
        anr(2,1)=xla0
        anr(2,2)=xle
        anr(2,3)=xlt
        do 56 j=1,3
          ainr(1,j)=ainr(1,j)+anr(1,j)*coef
          ainr(2,j)=ainr(2,j)+anr(2,j)*sbor*step
   56   continue
   51 continue
 
c ---- integrated values of apparent reflectance, radiance          ---- 
c ---- and gaseous transmittances (total,downward,separately gases) ----
      refet=refet/seb
      refet1=refet1/seb
      refet2=refet2/seb
      refet3=refet3/seb
      tgasm=tgasm/seb
      dgasm=dgasm/seb
      ugasm=ugasm/seb
      sasa=sasa/seb
      sasr=sasr/seb
      sast=sast/seb
      sdniox=sdniox/seb
      sdmoca=sdmoca/seb
      sdmeth=sdmeth/seb
      sdwava=sdwava/seb
      sdozon=sdozon/seb
      sddica=sddica/seb
      suniox=suniox/seb
      sumoca=sumoca/seb
      sumeth=sumeth/seb
      suwava=suwava/seb
      suozon=suozon/seb
      sudica=sudica/seb
      suoxyg=suoxyg/seb
      sdoxyg=sdoxyg/seb
      stniox=stniox/seb
      stmoca=stmoca/seb
      stmeth=stmeth/seb
      stwava=stwava/seb
      stozon=stozon/seb
      stdica=stdica/seb
      stoxyg=stoxyg/seb
      sdtotr=sdtotr/seb
      sdtota=sdtota/seb
      sdtott=sdtott/seb
      sutotr=sutotr/seb
      sutota=sutota/seb
      sutott=sutott/seb
      rog=rog/seb
      sroray=sroray/seb
      sroaer=sroaer/seb
      srotot=srotot/seb
      alumet=alumet/sb
      pizera=0.0
      if(iaer.ne.0) pizera=ssdaer/sodaer
      sodray=sodray/seb
      sodaer=sodaer/seb
      sodtot=sodtot/seb
      sodrayp=sodrayp/seb
      sodaerp=sodaerp/seb
      sodtotp=sodtotp/seb
      fophsa=fophsa/seb
      fophsr=fophsr/seb
 
      do 57 j=1,3
        aini(1,j)=aini(1,j)/seb
        ainr(1,j)=ainr(1,j)/seb
        aini(2,j)=aini(2,j)/sb
        ainr(2,j)=ainr(2,j)/sb
   57 continue

c**********************************************************************c
c                                                                      c
c                       atmospheric correction                         c
c                                                                      c
c               if itype=-1 : the code retrieve the value of the       c
c               surface reflectance (rog) value that will produce a    c
c               'reflectance' (radiance*pi/(mus*es)) equal to rapp     c
c               where mus is the cosine of solar zenith angle,         c
c               es is the solar constant integrated upon the           c
c               filter response and taking account for earth-solar     c
c               distance, es is in [w/m2/sr/mic].                      c
c                                                                      c
c               if itype =0 :  the code first calculates the apparent  c
c               radiance of the image andf then will calculate the     c
c               surface reflectance (rog). In this case the input      c
c               image has digital numbers that need to be transformed  c
c               to radiance and then reflectance. This condition is    c
c               valid only for ETM+ Landsat7, image taken before July  c
c               1, 2000. Data form the following page:                 c
c        http://ltpwww.gsfc.nasa.gov/IAS/handbook/handbook_toc.html    c
c                                                                      c
c               if itype =1 :  the code first calculates the apparent  c
c               radiance of the image andf then will calculate the     c
c               surface reflectance (rog). In this case the input      c
c               image has digital numbers that need to be transformed  c
c               to radiance and then reflectance. This condition is    c
c               valid only for ETM+ Landsat7, image taken after July   c
c               1, 2000.                                               c
c                                                                      c
c               if itype =2 :  the code retrieve the value of the      c
c               surface reflectance (rog) that will produce a radiance c
c               equal to rapp [w/m2/str/mic] in the atmospheric        c
c               conditions described by user before                    c
c                                                                      c
c In summary:															 c
c       itype = -1 => the image has values of reflectance for any		 c
c                     sensor											 c
c       itype =  0 => the image has digital numbers from ETM+ taken	 c
c				    before July 1, 2000.							 c
c       itype =  1 => the image has digital numbers from ETM+ taken	 c
c				    after July 1, 2000.								 c
c       itype =  2 => the image has values of radiance for any sensor	 c
c                                                                      c
c**********************************************************************c

	if (itype.eq.0) then          ! ETM+ digital numbers taken before July 1, 2000
	  if (iwave.eq.61) then
	    lmin=-6.2
		lmax=194.3
	  endif
	  if (iwave.eq.62) then
	    lmin=-6.0
		lmax=202.4
	  endif
	  if (iwave.eq.63) then
	    lmin=-4.5
		lmax=158.6
	  endif
	  if (iwave.eq.64) then
	    if (asol.lt.45.) then
	      lmin=-4.5
		  lmax=235.0
		 else
		   lmin=-4.5
		   lmax=157.5
	     endif
	  endif
	  if (iwave.eq.65) then
	    lmin=-1.0
		lmax=31.76
	  endif
	  if (iwave.eq.66) then
	    lmin=-0.35
		lmax=10.932
	  endif
	  if (iwave.eq.67) then
	    lmin=-5.0
		lmax=244.00
	  endif
	endif

	if (itype.eq.1) then          ! ETM+ digital numbers taken after July 1, 2000
	  if (iwave.eq.61) then
	    lmin=-6.2
		lmax=191.6
	  endif
	  if (iwave.eq.62) then
	    lmin=-6.4
		lmax=196.5
	  endif
	  if (iwave.eq.63) then
	    lmin=-5.0
		lmax=152.9
	  endif
	  if (iwave.eq.64) then
	    if (asol.lt.45.) then
		  lmin=-5.1
		  lmax=241.1
	    else
	      lmin=-5.1
		  lmax=157.4
	    endif
	  endif
	  if (iwave.eq.65) then
	    lmin=-1.0
		lmax=31.06
	  endif
	  if (iwave.eq.66) then
	    lmin=-0.35
		lmax=10.80
	  endif
	  if (iwave.eq.67) then
	    lmin=-4.7
		lmax=243.1
	  endif
	endif

c**********************************************************************c
c *********  MAIN LOOP FOR ATMOSPHERIC CORRECTION OF IMAGES  ********* c 
c**********************************************************************c

      negn=0
	nlpix=0
	ipixf=40960        ! 40960 is the buffer size*number of buffers
	if (ipixf.gt.ntpixels) ipixf=ntpixels

      do 6000 ncorr=1,100000
	  do 6050 iclr=1,ipixf
	    irog(iclr)=0
		irapp(iclr)=0
 6050   continue
        read(7,iostat=ios,end=6100)(irapp(ipixel),ipixel=1,ipixf)
 6100   do 6200 ipixel=1,ipixf
          ainrpix=0.0
          ainrpix=ainr(1,1)
          xa=0.0
          xb=0.0
          xc=0.0
          xrad=0.0
	    rapp=0.0
          rog=0.0
	    irapp1=0
          if (irapp(ipixel).ne.0) then

            if (itype.eq.0.or.itype.eq.1) then  ! Digital Numbers from ETM+ Landsat7
              if (irapp(ipixel).lt.0) then
			  irapp1=256+irapp(ipixel)
              else
	          irapp1=irapp(ipixel)
	        endif
              xrad=(lmax-lmin)/254.             ! http://ltpwww.gsfc.nasa.gov/IAS/handbook/handbook_toc.html
			xrad=xrad*(float(irapp1)-1.)+lmin
              rapp=pi*xrad*sb/xmus/seb
	        if (rapp.lt.0.) rapp=0.0
	        imagapp(ipixel)=nint(rapp*255.)
	      else
              if (irapp(ipixel).ge.0) rapp=float(irapp(ipixel))/255.
              if (irapp(ipixel).lt.0) then
			   rapp=(256.+float(irapp(ipixel)))/255.
              endif
              if (itype.eq.2) then           ! Image in radiance values scalled
                xrad=rapp                    ! between 0 and 255 gray levels
                rapp=pi*xrad*sb/xmus/seb
	        endif
              if (itype.eq.-1) then          ! Image in reflectance values scalled
                xrad=xmus*seb*(rapp)/pi/sb   ! between 0 and 255 gray levels
              endif
            endif
            rog=rapp/tgasm

            ! The if below was added to avoid ground reflectances lower than
	      ! zero when ainr(1,1) greater than rapp/tgasm
	      ! In such case either the choice of atmospheric model was not 
		  ! adequate for that image or the calculated apparent reflectance
		  ! was too low. Run the model again for other conditions.
	      ! The lines below just decrease ainr(1,1)/tgasm to avoid too
	      ! bright pixels in the image. Check the output file to see if that
	      ! has happened.
	      decrfact=1.0
            if (rog.lt.(ainrpix/tgasm)) then
 6301         decrfact=decrfact - 0.1
              ainrpix=decrfact*ainrpix
              if (rog.lt.(ainrpix/tgasm)) goto 6301
              negn=negn+1
            endif
            rog=(rog-ainrpix/tgasm)/sutott/sdtott
            rog=rog/(1.+rog*sast)
            xa=pi*sb/xmus/seb/tgasm/sutott/sdtott
            xb=srotot/sutott/sdtott/tgasm
            xc=sast
            if (rog.gt.1.) rog=1.
            if (rog.lt.0.) rog=0.
            irog(ipixel)=nint(rog*255.)
	    else
            irog(ipixel)=0
          endif

 6200   continue
      write(8) (irog(ipixel),ipixel=1,ipixf)
      if (itype.eq.0.or.itype.eq.1) then      ! Digital Numbers from ETM+ Landsat7
	  write(11) (imagapp(ipixel),ipixel=1,ipixf)
      endif
	nlpix=nlpix+ipixf
	if (nlpix.eq.ntpixels) goto 6001
	if ((nlpix+40960).gt.ntpixels) ipixf=ntpixels-nlpix
	if (ios.lt.0) goto 6001

 6000 continue

 6001 if (negn.gt.0) then
        write(iwr, 6300) negn
 6300 format  (//,80(1h*),//,' ATENCAO   !!!!',//,' O modelo calculou va
     &lores de ainr(1,1)/tgasm > rapp/tgasm ',i10,' vezes,',/,' signific
     &ando que a reflectancia intrinsica da atmosfera',/,' eh maior do q
     &ue a reflectancia aparente.',//,' FAVOR ESCOLHER OUTRO MODELO DE A
     &TMOSFERA E DE AEROSSOL.',//,' Se mantido isso levaria a valores de
     & refletancia negativos,',/,' os quais implicariam em valores proxi
     &mos a 255 (pontos bem claros na imagem).',/,' Para evitar isso os 
     &valoreres de ainr(1,1)/tgasm,',/,' foram diminuidos, mas eh aconse
     &lhavel selecionar condicoes',/,' atmosfericas mais apropriadas.',/
     &/,80(1h*),/)
	endif

 6305 stop
 
