      wls(6)=2.1925
      wli(7)=3.58
      wls(7)=3.87
      wli(8)=0.455
      wls(8)=0.485
      wli(9)=1.21 
      wls(9)=1.27
      wli(10)=1.6075 
      wls(10)=1.6725
      do 1 i=1,1501
      s(i)=sr(iwa,i)
    1 continue
